import "../css/TestDisplay.css";

function TestResult() {
  return (
    <>
      <div className="container">
        {answer == "concat" ? (
          <>
            <img
              src={require("../icons/successfully-done.gif")}
              width="40"
              height="40"
            />
          </>
        ) : (
          <>
            <img src={require("../icons/close.gif")} width="40" height="40" />
          </>
        )}
      </div>
    </>
  );
}

export default TestResult;
